import './App.css';
import HomePage from './pages/homePage/homPage';
import { Route, Switch } from 'react-router-dom';

function App() {
  const HatsPage = () => (
    <div>
      <h1>HomePage</h1>
    </div>
  );

  return (
    <div>
      <Switch>
        <Route exact path='/' component={HomePage} />
        <Route exact path='/hat' component={HatsPage} />
      </Switch>
    </div>
  );
}

export default App;
